import axios from "axios";
import { useRef, useState, useEffect} from "react";
import infiniteScroll from 'infinite-scroll';
import './App.css';

export default function App() {
    const [results, setResults] = useState([])
    useEffect(() => {
      axios
        .get('./Foodsource.json?page=2&limit=50')
        .then(res => { 
          setResults(res.data)
        })
        .catch(e => { console.log(e)}) },[]);
        const displayData = results.map(
          (info)=> {
            return(
              <tr>
                <td>{info.id}</td>
                <td>{info.resteraunt}</td>
                <td>{info.name}</td>
                <td>{info.people}</td>
                <td>{info.timetag}</td>
              </tr>
            )
          }
        )





        useEffect(() => {

          const row = document.querySelectorAll(".card")

        {/* main observer */}
          const observer = new IntersectionObserver(entries => {
            entries.forEach(entry => {
              entry.target.classList.toggle("show", entry.isIntersecting)
            })
          },
          {
            threshold: 0.5,
            rootMargin: "+20px"
          }
          )


          {/* last observer */}
          const lastRowObserver = new IntersectionObserver(entries => {
            const lastRow = entries[0]
            if (!lastRow.isIntersecting) return
            let firstTD = lastRow.target.firstElementChild.getElementsByTagName("td")[0].textContent
            loadNewitems(firstTD)
            lastRowObserver.unobserve(lastRow.target)
            lastRowObserver.observe(document.querySelector(".card:last-child"))
            }, {})
            lastRowObserver.observe(document.querySelector(".card:last-child"))


          const cardContainer = document. querySelector(".card-container")


          {/* will summon new items from the list */}
          function loadNewitems(prev) {
            for (let i = prev; i < prev + 2; i++) {
              const item = document.createElement("div")
              console.log(displayData[i])
              item.textContent = displayData[i]
              item.classList.add("card")
              observer.observe(item)
              cardContainer.append(item)
            }
          }

          row.forEach(val => { 
            observer.observe(val)
          }) 

        })







  return (
    <div className="App">
      <div class="card-container">
      <div class="card"> {displayData.slice(0,1)}</div>
      <div class="card"> {displayData.slice(1,2)}</div>
      <div class="card"> {displayData.slice(2,3)}</div>
      <div class="card"> {displayData.slice(3,4)}</div>
      <div class="card"> {displayData.slice(4,5)}</div>
      <div class="card"> {displayData.slice(5,6)}</div>
      <div class="card"> {displayData.slice(6,7)}</div>
      <div class="card"> {displayData.slice(7,8)}</div>
      <div class="card"> {displayData.slice(8,9)}</div>
      <div class="card"> {displayData.slice(9,10)}</div>
      <div class="card"> {displayData.slice(10,11)}</div>
      <div class="card"> {displayData.slice(11,12)}</div>
      <div class="card"> {displayData.slice(12,13)}</div>
      <div class="card"> {displayData.slice(13,14)}</div>
      <div class="card"> {displayData.slice(14,15)}</div>
      <div class="card"> {displayData.slice(15,16)}</div>
      <div class="card"> {displayData.slice(16,17)}</div>
      <div class="card"> {displayData.slice(17,18)}</div>
      <div class="card"> {displayData.slice(18,19)}</div>
      <div class="card"> {displayData.slice(19,20)}</div>
      <div class="card"> {displayData.slice(21,22)}</div>
      <div class="card"> {displayData.slice(23,24)}</div>
      </div>
    </div>


  );
}
